$(document).ready(function(){

// Accordions Start

  $( function() {
    var icons = {
      header: "ui-icon-circle-arrow-e",
      activeHeader: "ui-icon-circle-arrow-s"
    };
    $( ".accordion" ).accordion({
      icons: icons,
      active: false,
      collapsible: true,
      alwaysOpen: false,
      heightStyle: "content",
      autoHeight: false      
    });
    $( "#toggle" ).button().on( "click", function() {
      if ( $( ".accordion" ).accordion( "option", "icons" ) ) {
        $( ".accordion" ).accordion( "option", "icons", null );
      } else {
        $( ".accordion" ).accordion( "option", "icons", icons );
      }
    });
  } );

// Accordions End

// Tabs from Gridelements Start

  $(function() {
    $("#tabs").tabs({
    	show: 'fade',
    	hide: 'fade'
    });
  });


// Tabs from Gridelements End 

	// Sticky Nav onScroll Start
		
		$('body').removeClass('sticky stickyFade stickyActive');
		//console.log("stick removed");
				
		var  mn = $("header");
		//mns = "sticky";
		mns = "sticky stickyFade stickyActive";
		hdr = $('header .grid-container').height();

		$(window).scroll(function() {
			if( $(this).scrollTop() > hdr ) {
			mn.addClass(mns)
			} else {
			mn.removeClass(mns)
			}
		});
	
// Stick Nav onScroll End
		
// Mobile Navigation Start
/*		$('#navigation').slicknav({
			label: 'Menü',
			duration: 400,
			easingOpen: "swing",
			easingClose: "swing",
			prependTo:'.grid-70 nav',
			nestedParentLinks: false,
			allowParentLinks: true
		}); */
		
		
var newURL = window.location.href;
console.log(newURL);

//$("#langEN").attr('href','#');

		
$("#mainNav").mmenu({
   // options
    extensions: [
   		"pagedim-white",
    	"theme-dark",
    	"justified-listview",
    	"effect-menu-fade",
    	"effect-panels-slide-100",
        "effect-listitems-slide"
    ],
    "navbars": [
            {
               "position": "top",
               "content": [
                  $("#langNav").clone()
               ]
            }
     ],    
    "offCanvas": {
            "position": "right",
            //"pageNodetype": "header",
            "pageSelector":"#globalWrapper"
    }
	}, {
   // configuration
	
   	clone: true
});


// Mobile Navigation End

	
// Smoothscroll Start
	
$('#toTop a').smoothScroll({
	speed: 700
});


// unhide container on click 

$(".csc-frame-invisible").hide();
$(".magicBox").hide();

$(".showMore").click(function(){
	//$("div").removeClass("csc-frame-invisible");
	$(".csc-frame-invisible").show(500);
	$(".magicBox").fadeIn(1500);
	$(".showMore").hide();
});





		
}); // documentReady End
		
		
